import React, { useEffect, useState } from 'react';
import VehicleList from '../components/VehicleList';
import VehicleForm from '../components/VehicleForm';
import { fetchVehiclesData } from '../services/api';

const VehiclesPage = () => {
    const [vehicles, setVehicles] = useState([]);
    const [selectedVehicle, setSelectedVehicle] = useState(null);

    useEffect(() => {
        const getVehicles = async () => {
            const data = await fetchVehiclesData();
            setVehicles(data);
        };
        getVehicles();
    }, []);

    const handleEdit = (vehicle) => {
        setSelectedVehicle(vehicle);
    };

    const handleDelete = async (id) => {
        // Implement delete functionality here
    };

    return (
        <div>
            <h1>Gerenciamento de Veículos</h1>
            <VehicleForm selectedVehicle={selectedVehicle} setSelectedVehicle={setSelectedVehicle} />
            <VehicleList vehicles={vehicles} onEdit={handleEdit} onDelete={handleDelete} />
        </div>
    );
};

export default VehiclesPage;
